iPhoto 7.1.1',39,0,NULL,'2017-06-19 21:14:00'),(238,'iLife \'06',0,0,'','2017-06-19 21:14:00'),(240,'iPhoto 7',39,0,NULL,'2017-06-19 21:14:00'),(241,'iMovie 7.0',0,0,'iMovie 7.1  <br />  <h2>About iMovie 7.1</h2>  <p>iMovie ’08 makes viewing and working with video as intuitive as enjoying your photos. A built-in library automatically organizes your video, so all the clips you’ve captured and movies you’ve created are just a click away. With its revolutionary interface, iMovie makes it quick and easy to browse your library and create new movies. And iMovie is built for sharing. In just a few steps, you can add movies to your website, publish them on YouTube, and create versions for iPod, iPhone, and Apple TV.  <br />  <br />Learn more about iMovie.  <br />  <br />  <b>What’s New in this Version</b>  <br />This update addresses several areas including video and audio editing capabilities, and performance associated with opening and switching iMovie Events and Projects. This update also supports general compatibility issues, improves overall stability, and addresses a number of other minor issues.  <br />  <br />iMovie 7.1 features include:  <br />  <br />Multiple Clip Selection  <br />Select multiple clips in order to assign keywords, paste adjustments or reorganize clips in your project faster than ever.  <br />  <br />Fine Tuning  <br />Quickly refine the start or end frame for any clip without leaving the Project view.  <br />  <br />Still Frame Creation  <br />Freeze the action for creating a dramatic ending or applying the “Ken Burns” effect on any frame of your video clip.  <br />  <br />Frame-by-Frame trimming  <br />Adjust each clip to the perfect start or end frame using frame-by-frame precision trimming.  <br />  <br />Audio Ducking level control  <br />Dip music tracks and background tracks to the perfect level as voice over or other audio comes in and out of your movie.  <br />  <br />Manual Audio Fades  <br />Make smoother sounding audio transitions by manually adjusting the fade duration.  <br />  <br />Performance Improvements  <br />Enjoy you video more quickly by switching between any of your Events.  <br />  <br />Set Duration for Transitions and Stills  <br />Change the duration of photos or length of your transitions without accessing Preferences.  <br />  <br />Show Current Playhead Time  <br />Get duration or timing information at a glance as you skim through your Events or movie.  <br />  <br />  <b>Note</b>  <br />In order to install this update you will need to download the iLife Support 8.1.1 update first. The iLife update supports system software components used by all iLife application, improves overall stability, addresses a number of other minor issues and supports general compatibility issues.</p><br/><br/>iMovie 7.1  <br />  <p>iMovie ’08 makes viewing and working with video as intuitive as enjoying your photos. A built-in library automatically organizes your video, so all the clips you’ve captured and movies you’ve created are just a click away. With its revolutionary interface, iMovie makes it quick and easy to browse your library and create new movies. And iMovie is built for sharing. In just a few steps, you can add movies to your website, publish them on YouTube, and create versions for iPod, iPhone, and Apple TV.  <br />  <br />Learn more about iMovie.  <br />  <br />  <b>What’s New in this Version</b>  <br />This update addresses several areas including video and audio editing capabilities, and performance associated with opening and switching iMovie Events and Projects. This update also supports general compatibility issues, improves overall stability, and addresses a number of other minor issues.  <br />  <br />iMovie 7.1 features include:  <br />  <br />Multiple Clip Selection  <br />Select multiple clips in order to assign keywords, paste adjustments or reorganize clips in your project faster than ever.  <br />  <br />Fine Tuning  <br />Quickly refine the start or end frame for any clip without leaving the Project view.  <br />  <br />Still Frame Creation  <br />Freeze the action for creating a dramatic ending or applying the “Ken Burns” effect on any frame of your video clip.  <br />  <br />Frame-by-Frame trimming  <br />Adjust each clip to the perfect start or end frame using frame-by-frame precision trimming.  <br />  <br />Audio Ducking level control  <br />Dip music tracks and background tracks to the perfect level as voice over or other audio comes in and out of your movie.  <br />  <br />Manual Audio Fades  <br />Make smoother sounding audio transitions by manually adjusting the fade duration.  <br />  <br />Performance Improvements  <br />Enjoy you video more quickly by switching between any of your Events.  <br />  <br />Set Duration for Transitions and Stills  <br />Change the duration of photos or length of your transitions without accessing Preferences.  <br />  <br />Show Current Playhead Time  <br />Get duration or timing information at a glance as you skim through your Events or movie.  <br />  <br />  <b>Note</b>  <br />In order to install this update you will need to download the iLife Support 8.1.1 update first. The iLife update supports system software components used by all iLife application, improves overall stability, addresses a number of other minor issues and supports general compatibility issues.</p><br/>','2017-06-19 21:14:00'),(242,'iPhoto 6.0.5',39,0,NULL,'2017-06-19 21:14:00'),(243,'Intel based Macintosh running Mac OS X 10.4.8 Client or Server',39,0,NULL,'2017-06-19 21:14:00'),(244,'PPC based Macintosh running Mac OS X 10.4.8 Server',13,0,NULL,'2017-06-19 21:14:00'),(245,'GarageBand 3.0.2 or later',0,0,'','2017-06-19 21:14:00'),(246,'iPhoto 6.0.4',39,0,NULL,'2017-06-19 21:14:00'),(247,'iWeb 1.1.1',0,0,'iWeb 1.1.2  <br />  <h2>About iWeb 1.1.2</h2>  <p>iWeb is the easiest way to share your photos, movies, audio and playlists on the Internet via stunning web pages, online photo albums, blogs, and podcasts. Apple-designed templates let you create beautiful websites in minutes, and the iLife Media Browser makes adding your media as simple as drag and drop. You can even select items from within the other iLife applications and send it directly to iWeb. With a single click, iWeb encodes your pages, updates your RSS feeds, adds any required passwords, announces your site to friends and family, and publishes everything directly to .Mac.  <br />  <br />Learn more about iweb  <br />  <br />  <b>What’s New in this Version</b>  <br />This update addresses compatibility for accessing Aperture 1.5 content in iWeb.</p><br/><br/>iWeb 1.1.2  <br />  <p>iWeb is the easiest way to share your photos, movies, audio and playlists on the Internet via stunning web pages, online photo albums, blogs, and podcasts. Apple-designed templates let you create beautiful websites in minutes, and the iLife Media Browser makes adding your media as simple as drag and drop. You can even select items from within the other iLife applications and send it directly to iWeb. With a single click, iWeb encodes your pages, updates your RSS feeds, adds any required passwords, announces your site to friends and family, and publishes everything directly to .Mac.  <br />  <br />Learn more about iweb  <br />  <br />  <b>What’s New in this Version</b>  <br />This update addresses compatibility for accessing Aperture 1.5 content in iWeb.</p><br/>','2017-06-19 21:14:00'),(248,'Mac OS X 10.4.4 recommended',13,0,NULL,'2017-06-19 21:14:00'),(249,'iMovie HD 6.0.2',0,0,'iMovie HD 6.0.3  <br />  <h2>About iMovie HD 6.0.3</h2>  <p>With an abundance of powerful new features and possibilities, iMovie HD 6 continues to be the fastest and easiest way to turn a home video into your own Hollywood-style hit that you can share with family and friends via iDVD, email, your iPod or other compatible mobile device. And iMovie HD 6 is the easiest way to create a video podcast, which you can share with the world via the Internet with iWeb and .Mac.  <b