r more information, see Mac Help, available in the Help menu.</p><br/><br/>iMovie HD 6.0.3  <br />  <p>With an abundance of powerful new features and possibilities, iMovie HD 6 continues to be the fastest and easiest way to turn a home video into your own Hollywood-style hit that you can share with family and friends via iDVD, email, your iPod or other compatible mobile device. And iMovie HD 6 is the easiest way to create a video podcast, which you can share with the world via the Internet with iWeb and .Mac.  <br />  <br />For the latest news and information about iMovie HD, go to the iMovie HD website at www.apple.com/ilife/imovie.  <br />  <br />  <b>What’s New in this Version</b>  <br />  <br />This update addresses compatibility for accessing Aperture 1.5 content in iMovie HD. It also improves overall stability and addresses a number of other minor issues.  <br />  <br />  <b>System requirements</b>  <br />  <br />To install iMovie HD 6.0.3, you need:  <br />- A Macintosh computer with a PowerPC G4, PowerPC G5, or Intel Core processor (512 MB of RAM required for HDV support)  <br />- 256MB of RAM; 512MB recommended  <br />- Mac OS X v10.3.9 or v10.4.3 or later; Mac OS X v10.4.4 recommended  <br />- QuickTime v7.0.4 or later (v7.0.4 included with iLife ’06)  <br />  <br />Additional requirements:  <br />- High definition video (HDV) requires a minimum of a 1GHz G4 or faster processor and 512MB of RAM.  <br />- Mac OS X v10.4.4 is required for Audio FX; and Quartz Extreme is required for iMovie motion themes, real-time effects, and the Ken Burns Effect.  <br />- A .Mac account is recommended for iWeb; fees and terms apply.  <br />  <br />For optimum performance, update your system software to the latest version of Mac OS X and QuickTime. To make sure you have the latest versions, choose Apple &gt; System Preferences and click Software Update. Click Check Now or Update Now to retrieve updates for your system. After you install an update, it’s a good idea to click 