icator (suggested for DVD-9 projects):</b>  <br />-DLT drive  <br />  <br />  <b>For transporting projects on disc that contain copy-protection or dual-layer features to a replicator: authoring DVD drive</b>  <br />- DVD Studio Pro 4.0  <br />- Mac OS X v10.3.9 or later  <br />- QuickTime 7.0 or later  <br />- Valid DVD Studio Pro 4 or Final Cut Studio serial number</p><br/>','2017-06-19 21:14:00'),(324,'QuickTime 7.0 or later',39,0,NULL,'2017-06-19 21:14:00'),(325,'v. OS X 10.3.9',10,0,NULL,'2017-06-19 21:14:00'),(326,'WaveBurner 1.1',0,0,'WaveBurner 1.1.2  <br />  <h2>About WaveBurner 1.1.2</h2>  <p>Addresses isolated reliability issues. The update is highly recommended for all users of WaveBurner 1.1.  <br />  <br />An existing WaveBurner 1.1 installation is required for this update to take effect.</p><br/><br/>WaveBurner 1.1.2  <br />  <p>Addresses isolated reliability issues. The update is highly recommended for all users of WaveBurner 1.1.  <br />  <br />An existing WaveBurner 1.1 installation is required for this update to take effect.</p><br/>','2017-06-19 21:14:00'),(327,'Requires OS X 10.3.9 or',10,0,NULL,'2017-06-19 21:14:00'),(328,'Logic Pro 7.1',0,0,'Logic Pro Update 7.1.1  <br />  <h2>About Logic Pro Update 7.1.1</h2>  <p>  <!-- switch image off --> The industry-leading application for music creation and audio production dramatically broadens the capabilities of computer-based studio environments with Logic Pro 7. The first choice of many prominent musicians and producers, Logic Pro 7 provides the most comprehensive collection of music creation tools.  <br />  <br />Learn more about Logic Pro.  <br />  <br />  <b>What’s New in this Version</b>  <br />Addresses isolated reliability issues. It also improves compatibility with Mac OS X version 10.4 (Tiger).  <br />  <br />The most significant areas addressed are:  <br />- MP3 and AAC import in Mac OS X Tiger  <br />- Use of Scandinavian keyboard layout in Mac OS X Tiger  <br />- Delay compensation of Quic