er. Please copy it to the Node machine(s) and run it.</p><br/>','2017-06-19 21:14:00'),(329,'Logic Express 7.1',0,0,'Logic Express Update 7.1.1  <br />  <h2>About Logic Express Update 7.1.1</h2>  <p>  <!-- switch image off --> Create your own music using an advanced spectrum of features and tools for computer based music production. Logic Express provides a step up from GarageBand for aspiring musicians, producers and composers without breaking the bank. With the same flexible layout as Logic Pro, you can dive deeper into the creation and manipulation of audio and MIDI.  <br />  <br />Learn more about Logic Express  <br />  <br />  <b>What’s New in this Version</b>  <br />Addresses isolated reliability issues. It also improves compatibility with Mac OS X version 10.4 (Tiger).  <br />  <br />Most significant areas addressed are:  <br />- MP3 and AAC import in Mac OS X Tiger  <br />- Use of Scandinavian keyboard layout in Mac OS X Tiger  <br />- Automation tool: Support of S curve modes  <br />- “Enhance Pitch” plug-in  <br />- Realtime sample rate conversion  <br />  <br />For more information on this update, visit Logic Express 7.1.1 Enhancements</p><br/><br/>Logic Express Update 7.1.1  <br />  <p>  <!-- switch image off --> Create your own music using an advanced spectrum of features and tools for computer based music production. Logic Express provides a step up from GarageBand for aspiring musicians, producers and composers without breaking the bank. With the same flexible layout as Logic Pro, you can dive deeper into the creation and manipulation of audio and MIDI.  <br />  <br />Learn more about Logic Express  <br />  <br />  <b>What’s New in this Version</b>  <br />Addresses isolated reliability issues. It also improves compatibility with Mac OS X version 10.4 (Tiger).  <br />  <br />Most significant areas addressed are:  <br />- MP3 and AAC import in Mac OS X Tiger  <br />- Use of Scandinavian keyboard layout in Mac OS X Tiger  <br />- Automation tool: Support of S curve modes  <br />- “Enhance Pitch” plug-in  <br />- Realtime sample rate conversion  <br />  <br />For more information on this update, visit Logic Express 7.1.1 Enhancements</p><br/>','2017-06-19 21:14:00'),(330,'Mac OS X 10.3.2 or later',10,0,NULL,'2017-06-19 21:14:00'),(332,'Pro Applications Update 2005-01',0,0,'Qmaster 2.0.1  <br />  <h2>About Qmaster 2.0.1</h2>  <p>The Apple Qmaster 2.0.1 software update provides improved reliability and is recommended for all Apple Qmaster 2.0 users. If you use Compressor, you must update it to version 2.0.1 for compatibility with Apple Qmaster 2.0.1.  <br />  <br />For more information about the Apple Qmaster 2.0.1 update, download the most recent Late-Breaking News document by opening Apple Qmaster and choosing Help &gt; Late-Breaking News.</p><br/><br/>Qmaster 2.0.1  <br />  <p>The Apple Qmaster 2.0.1 software update provides improved reliability and is recommended for all Apple Qmaster 2.0 users. If you use Compressor, you must update it to version 2.0.1 for compatibility with Apple Qmaster 2.0.1.  <br />  <br />For more information about the Apple Qmaster 2.0.1 update, download the most recent Late-Breaking News document by opening Apple Qmaster and choosing Help &gt; Late-Breaking News.</p><br/>','2017-06-19 21:14:00'),(333,'Compressor 2.0',0,0,'Compressor 2.0.1  <br />  <h2>About Compressor 2.0.1</h2>  <p>The Compressor 2.0.1 software update provides improved reliability and is recommended for all Compressor 2.0 users. If you use Apple Qmaster, you must update it to version 2.0.1 for compatibility with Compressor 2.0.1.  <br />  <br />For more information about the Compressor 2.0.1 update, download the most recent Late-Breaking News document by opening Compressor and choosing Help &gt; Late-Breaking News.</p><br/><br/>Compressor 2.0.1  <br />  <p>The Compressor 2.0.1 software update provides improved reliability and is recommended for all Compressor 2.0 users. If you use Apple Qmaster, you must update it to version 2.0.1 for compatibility with Compressor 2.0.1.  <br />  <br />For more information about the Compressor 2.0.1 update, download the most recent Late-Breaking News document by opening Compressor and choosing Help &gt; Late-Breaking News.</p><br/>','2017-06-19 21:14:00'),(334,'Existing Logic Pro 7 installation required.',0,0,'Logic Pro Update 7.0.1  <br />  <h2>About Logic Pro Update 7.0.1</h2>  <p>  <!-- switch image off --> Enhances reliability and performance.  <br />Furthermore, it contains improvements in the following areas:  <br />  <br />-Compatibility with Audio Units and other formats  <br />-Track Automation  <br />-Control Surfaces  <br />-Ultrabeat  <br />-Various further improvements  <br />  <br />  <b>Note:</b> The update improves compatibility with a number of Audio Units plug-ins.  <br />Your Audio Units plug-ins will be rescanned the first time Logic Pro 7.0.1 is launched.  <br />  <br />The Logic Pro 7.0.1 Update is highly recommended for all users of Logic Pro 7.  <br />An existing Logic Pro 7 installation is required for this update to take effect.  <br />  <br />To use Logic Pro 7.0.1 with the Logic Node application, an update of the Node software is required on your Node machines.  <br />The Node update software is contained in the Logic Pro 7.0.1 Update package and will be installed into Application/Utilities.  <br />  <br />Compatibility fixes  <br />-Apple Loops playback correctly in sessions with sample rates other than 44.1 kHz.  <br />-Recycle files consistently import as expected.  <br />-All Acid Loops transpose in Loop Browser as expected.  <br />-TDM tracks are successfully bounced even when native bounce is set to “offline”.  <br />-Audio Suite plug-ins process correctly regardless of whether there are open floating windows.  <br />-Both sides of a split stereo file are converted when performing a sample rate conversion within the Sample Editor.  <br />  <br />Track Automation fixes  <br />-The Copy/Convert function behaves properly.  <br />-The names of Pitch Correction plug-in parameters are displayed correctly.  <br />  <br />Control Surface Support fixes  <br />-Logic Control no longer generates notes in Learn mode.  <br />-All plug-in parameter names are displayed correctly.  <br />-Yamaha mixers no longer install multiple times in the Setup window.  <br />-Assignments are now possible in the Controls View.  <br />-Surround Joysticks work properly.  <br />  <br />Ultrabeat fixes  <br />-Accents in sequencer now perform consistently.  <br />-There are no longer graphic glitches when copying step sequences.  <br />-The Import of Ultrabeat factory drum kits now works consistently.  <br />-Drum voices begin playback more quickly when auditioning while importing a Ultrabeat kit.  <br />-Automating more than one Ultrabeat drum voice now works as expected.  <br />General fixes  <br />-Loading a Channels Strip Setting will no longer switches the “Transpose” instrument parameter on.  <br />-The Guitar Amp mic position setting is not lost when loading a Channel Strip Setting from Logic Express into Logic Pro.  <br />- MIDI device names from Audio MIDI Setup or Logic Setup Assistant show up properly in default song.  <br />-Multi-Instrument Bank Messages won’t change when importing a Song from Logic Pro 6.4.3.  <br />-“Goto Position” window does not inadvertently switch to current SPL position when opened.  <br />-“Send to MIDI” Maximum Volume” sends to all channels, not just channel 1.  <br />-Guitar Tablature preferences and tuning definitions can be entered via menu options again.  <br />-Screen updates now occur more consistently so there are less graphic glitches.  <br />  <br />Learn more about Logic Pro.</p><br/>','2017-06-19 21:14:00'),(335,'Existing Logic Express 7 installation required.',0,0,'Logic Express Update 7.0.1  <br />  <h2>About Logic Express Update 7.0.1</h2>  <p>  <!-- switch image off -->Enhances reliability and performance.  <br />Furthermore, it contains improvements in the