p><br/><br/>Logic Express Update 7.0.1  <br />  <p>  <!-- switch image off --> Enhances reliability and performance.  <br />Furthermore, it contains improvements in the following areas:  <br />  <br />-Compatibility with Audio Units and other formats  <br />-Track Automation  <br />-Control Surfaces  <br />-Various further improvements  <br />  <br />  <b>Note:</b> The update improves compatibility with a number of Audio Units plug-ins. Your Audio Units plug-ins will be rescanned the first time Logic Express 7.0.1 is launched.  <br />  <br />The Logic Express 7.0.1 Update is highly recommended for all users of Logic Express 7.  <br />An existing Logic Express 7 installation is required for this update to take effect.  <br />  <br />Compatibility fixes  <br />- Apple Loops playback correctly in sessions with sample rates other than 44.1 kHz.  <br />-Recycle files consistently import as expected.  <br />-All Acid Loops transpose in Loop Browser as expected.  <br />-Both sides of a split stereo file are converted when performing a sample rate conversion within the Sample Editor.  <br />  <br />Track Automation fixes  <br />-The Copy/Convert function behaves properly.  <br />  <br />Control Surface Support fixes  <br />-Logic Control no longer generates notes in Learn mode.  <br />-All plug-in parameter names are displayed correctly.  <br />-Assignments are now possible in the Controls View.  <br />  <br />General fixes  <br />-Loading a Channels Strip Setting will no longer switches the “Transpose” instrument parameter on.  <br />-MIDI device names from Audio MIDI Setup or Logic Setup Assistant show up properly in default song.  <br />- Multi-Instrument Bank Messages won’t change when importing a Song from Logic Express 6.4.3.  <br />-“Goto Position” window does not inadvertently switch to current SPL position when opened.  <br />-“Send to MIDI” Maximum Volume” sends to all channels, not just channel 1.  <br />-Guitar Tablature preferences and tuning definitions can be entered via menu options again.  <br />-Screen updates now occur more consistently so there are less graphic glitches.  <br />  <br />Learn more about Logic Express.</p><br/>','2017-06-19 21:14:00'),(336,'Mac OS X 10.3.5 or later',10,0,NULL,'2017-06-19 21:14:00'),(337,'867MHz PowerPC G4 or G5 processor with 4X AGP card',39,0,NULL,'2017-06-19 21:14:00'),(338,'512MB of RAM (2GB or more recommended)',39,0,NULL,'2017-06-19 21:14:00'),(339,'QuickTime 6.5.1 or later',39,0,NULL,'2017-06-19 21:14:00'),(340,'Display with 1024 x 768 resolution or higher',0,0,'Motion Update 1.0.1  <br />  <h2>About Motion Update 1.0.1</h2>  <p>  <!-- switch image off --> The only motion graphics package with real-time previews, procedural behavior animation and Final Cut Pro HD integration.  <br />  <br />Apple’s high-performance motion graphic design and production application lets you explore new creative territory using self-propelled behavior animation, character-by-character title animation and a powerful new interface. Motion integrates seamlessly with Final Cut Pro HD and DVD Studio Pro 3, making it quicker and easier than ever to create motion graphics for film, video and DVDs.  <br />  <br />Learn more about Motion.  <br />  <br />  <b>What’s New in this Version</b>  <br />- To take your Motion projects even further, you can download free effects, including five filters and one generator. You can also download additional tutorials to help you get the most out of Motion.</p><br/><br/>Motion Update 1.0.1  <br />  <p>  <!-- switch image off --> The only motion graphics package with real-time previews, procedural behavior animation and Final Cut Pro HD integration.  <br />  <br />Apple’s high-performance motion graphic design and production application lets you explore new creative territory using self-propelled behavior animation, character-by-character title animation and a powerful new interface. Motion integrates seamlessly with Final Cut Pro HD and DVD Studio Pro 3, making it quicker and easier than ever to create motion graphics for film, video and DVDs.  <br />  <br />Learn more about Motion.  <br />  <br />  <b>What’s New in this Version</b>  <br />- To take your Motion projects even further, you can download free effects, including five filters and one generator. You can also download additional tutorials to help you get the most out of Motion.</p><br/>','2017-06-19 21:14:00'),(341,'10GB of free hard disk space',0,0,'Motion Update 1.0.1  <br />  <h2>About Motion Update 1.0.1</h2>  <p>  <!-- switch image off --> The only motion graphics package with real-time previews, procedural behavior animation and Final Cut Pro HD integration.  <br />  <br />Apple’s high-performance motion graphic design and production application lets you explore new creative territory using self-propelled behavior animation, character-by-character title animation and a powerful new interface. Motion integrates seamlessly with Final Cut Pro HD and DVD Studio Pro 3, making it quicker and easier than ever to create motion graphics for film, video and DVDs.  <br />  <br />Learn more about Motion.  <br />  <br />  <b>What’s New in this Version</b>  <br />- To take your Motion projects even further, you can download free effects, including five filters and one generator. You can also download additional tutorials to help you get the most out of Motion.</p><br/><br/>AIO OSD AP  <br />This package provides the OSD AP for Vostro 3010 and Insprion 3045 Series running the following Windows operating systems: Windows 7 and 8.1.<br/>','2017-06-19 21:14:00'),(342,'QuickTime 6.5 or later',39,0,NULL,'2017-06-19 21:14:00'),(343,'Pro Application Support 1.1 or later',0,0,'Compressor 1.2.1  <br />  <h2>About Compressor 1.2.1</h2>  <p>If you are upgrading from Compressor 1.2, the Compressor 1.2.1 update includes the following features:  <br />• Improved application stability  <br />• Improved Preview window performance  <br />  <br />If you are upgrading from a version of Compressor prior to 1.2, the Compressor 1.2.1 update also includes the following features:  <br />• Support for MPEG-1 output files  <br />• Support for industry-standard letterbox aspect ratios  <br />• Support for saving batches  <br />• Preview window improvements  <br />• Improved high definition to standard definition transcoding  <br />• Timecode included in QuickTime output files  <br />• Optimized export using Compressor from the Final Cut Pro HD timeline  <br />  <br />Upgrading to Compressor 1.2.1 is highly recommended for all users of Compressor 1.0 or later.  <br />  <br />Note: Because Shake Qmaster and Compressor share the same Batch Monitor feature when both are installed on the same computer, you must upgrade to Shake Qmaster 1.2.1 when you upgrade to Compressor 1.2.1. You can update Shake Qmaster using Software Update.</p><br/><br/>LiveType 1.1.1  <br />  <h2>About LiveType 1.1.1</h2>  <p>This update adds several improvements to LiveType, including:  <br />• Improved compatibility with 3rd party LiveFont, textures, and objects  <br />• Improved media descriptions in the Timeline  <br />• Space bar plays project from current playhead position from any active window  <br />• Unformatted timecodes conform to Final Cut Pro method  <br />• Matte to Texture feature available from the Media Browserv • Effect order can be set from the Timeline by dragging  <br />• Improved snapping in the Timeline  <br />• Improved copying and pasting of effects  <br />• Option-click effect disclosure to view effects for all tracks  <br />• Improved memory usage  <br />• Individual effect assignment for selected characters  <br />• Replace function for images and movies (control-click)  <br />• Effects correctly interpolate between each other</p><br/>','2017-06-19 21:14:00'),(344,'A Macintosh computer with a PowerPC G4 or G5 processor and AGP (Accelerated Graphics Port) graphics card',39,0,NULL,'2017-06-19 21:14:00'),(345,'A Panasonic AJ-HD1200A VTR',0,0,'DVCProHD Components 1.1  <br /> 